import React from 'react';
import './style.css'

const Job = (props) => {
    return(
        <div className='w-50'>
            <img className='br3' src={props.logo}/>
            <h3 className='bg-whites'>
                {props.title}
            </h3>
        </div>
    );
}

export default Job;
